import React from 'react';
import logo from './logo.svg';
import { Component } from 'react';
import './App.css';

class Login extends Component {

  constructor () {
    super();
    this.state = {
      email: '',
      password: ''
    };
    this.handleChange = this.handleChange.bind(this);
  }

  handleChange (evt) {
    // check it out: we get the evt.target.name (which will be either "email" or "password")
    // and use it to target the key on our `state` object with the same name, using bracket syntax
    this.setState({ [evt.target.name]: evt.target.value });
  }

  render () {
    return (
      <form>

        <label>StakedTokens</label>
        <input type="number" name="Stake tokens" onChange={this.handleChange} />

        <label>LitPrice</label>
        <input type="number" name="nordicenergy token Price" onChange={this.handleChange} />


        <label>AverageNumberOfTx</label>
        <input type="number" name="Average Number of tx" onChange={this.handleChange} />


        <label>TxCost</label>
        <input type="number" name="Tx cost" onChange={this.handleChange} />


        <label>IsGenesisPhase</label>
        <input type="checkbox" name="Is genesis phase" onChange={this.handleChange} />

      </form>
    );
  }
}


function App() {
  return ( new Login()
    /*
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
    */
  );
}

export default App;
